import axios from 'axios';

const api = axios.create({
  baseURL: 'http://localhost:1337',  // Ensure Strapi is running on this base URL
});

export const fetchData = async () => {
  try {
    const response = await api.get('/your-endpoint');  // Replace '/your-endpoint' with the actual endpoint from Strapi
    return response.data;
  } catch (error) {
    console.error('Error fetching data', error);
    throw error;
  }
};
